import { React, Component } from 'react';

export default class Section extends Component {
    render() {
        return (
        <div>
            <section>
                <h1>Chocolate Pizza</h1>
                <h6>POSTED ON 15 DEC 2013 / DESSERTS</h6>
                <img src="print-icon.png" alt= 'print-icon'/>
            </section>
        </div>
        );   
     }
 }
